import React from 'react';
import './mobileNav.css';

class MobileNav extends React.Component {
  constructor(props) {
    super(props);

    this.active_color = "#cfcfcf";
    this.inactive_color = "#555555";

    this.state = {
        active_icon: "news", //by default, other is "map"
    };

  }

  render() {
    return (
      <div className="Mobile-nav-container">
        <div className="ion-icon-container">
            <div
                ><ion-icon name="newspaper-outline"></ion-icon>
            </div>
            <div className="Mobile-nav-labels">
                News
            </div>
        </div>
        <div className="ion-icon-container">
            <div>
                <ion-icon style={{color:this.active_color}} name="map-outline"></ion-icon>
            </div>
            <div className="Mobile-nav-labels">
                Map
            </div>
        </div>        
      </div>
    );
  }

}







export default MobileNav;
